import React, { useState } from 'react';
import Usuarios from '../vista-administrdor/usuarios-administrador';
import Productos from '../vista-administrdor/productos-administrador';
import Proveedores from '../vista-administrdor/';
import Inventario from './Inventario';
import Ventas from './Ventas';

const PanelAdmin = () => {
  const [seccion, setSeccion] = useState('usuarios-administrador');

  const renderSeccion = () => {
    switch (seccion) {
      case 'usuarios-administrador': return <Usuarios />;
      case 'productos-administrador': return <Productos />;
      case 'proveedores-administrador': return <Proveedores />;
      case 'inventario-administrador': return <Inventario />;
      case 'ventas-administrador': return <Ventas />;
      default: return <Usuarios />;
    }
  };

  return (
    <div>
      <h2>Panel Administrativo</h2>
      <nav>
        <button onClick={() => setSeccion('usuarios-administrador')}>Usuarios</button>
        <button onClick={() => setSeccion('productos-administrador')}>Productos</button>
        <button onClick={() => setSeccion('proveedores-administrador')}>Proveedores</button>
        <button onClick={() => setSeccion('inventario-administrador')}>Inventario</button>
        <button onClick={() => setSeccion('ventas-administrador')}>Ventas</button>
      </nav>
      <hr />
      <div>{renderSeccion()}</div>
    </div>
  );
};

export default PanelAdmin;
